=1"></script><![endif]--> </head> <body class="mediawiki ltr sitedir-ltr mw-hide-empty-elt ns-0 ns-subject page-Create rootpage-Create skin-vector action-view">		<div id="mw-page-base" class="noprint"></div> 		<div id="mw-head-base" class="noprint"></div> 		<div id="content" class="mw-body" role="main"> 			<a id="top"></a> 			<div id="siteNotice" class="mw-body-content"><!-- CentralNotice --></div><div class="mw-indicators mw-body-content"> <div id="mw-indicator-pp-default" class="mw-indicator"><a href="/wiki/Wikipedia:Protection_policy#semi" title="This article is semi-protected."><img alt="Page semi-protected" src="//upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Padlock-silver.svg/20px-Padlock-silver.svg.png" width="20" height="20" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Padlock-silver.svg/30px-Padlock-silver.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Padlock-silver.svg/40px-Padlock-silver.svg.png 2x" data-file-width="128" data-file-height="128" /></a></div> </div> <h1 id="firstHeading" class="firstHeading" lang="en">Create</h1>			<div id="bodyContent" class="mw-body-content"> 				<div id="siteSub" class="noprint">From Wikipedia, the free encyclopedia</div>				<div id="contentSub"></div> 								<div id="jump-to-nav" class="mw-jump"> 					Jump to:					<a href="#mw-head">navigation</a>, 					<a href="#p-search">search</a> 				</div> 				<div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr"><div class="mw-parser-output"><table role="presentation" class="mbox-small plainlinks sistersitebox" style="background-color:#f9f9f9;border:1px solid #aaa;color:#000"> <tr> <td class="mbox-image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/40px-Wiktionary-logo-en-v2.svg.png" width="40" height="40" class="noviewer" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/60px-Wiktionary-logo-en-v2.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/80px-Wiktionary-logo-en-v2.svg.png 2x" data-file-width="391" data-file-height="391" /></td> <td class="mbox-text plainlist">Look up <i><b><a href="https://en.wiktionary.org/wiki/create" class="extiw" title="wiktionary:create">create</a></b></i> in Wiktionary, the free dictionary.</td> </tr> </table> <p>To <b>create</b> is to make a new person, place, thing, or phenomenon. The term and its variants may also refer to:</p> <ul> <li><a href="/wiki/Creativity" title="Creativity">Creativity</a>, phenomenon whereby something new and valuable is created</li> </ul> <div style="clear: right; margin-bottom: .5em; float: right; padding: .5em 0 .8em 1.4em; background: none; width: auto;"> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Art,_entertainment,_and_media"><span class="tocnumber">1</span> <span class="toctext">Art, entertainment, and media</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#Brands_and_enterprises"><span class="tocnumber">2</span> <span class="toctext">Brands and enterprises</span></a></li> <li class="toclevel-1 tocsection-3"><a href="#Computing_and_technology"><span class="tocnumber">3</span> <span class="toctext">Computing and technology</span></a></li> <li class="toclevel-1 tocsection-4"><a href="#Organizations_and_programs"><span class="tocnumber">4</span> <span class="toctext">Organizations and programs</span></a></li> <li class="toclevel-1 tocsection-5"><a href="#Transportation"><span class="tocnumber">5</span> <span class="toctext">Transportation</span></a></li> <li class="toclevel-1 tocsection-6"><a href="#Other"><span class="tocnumber">6</span> <span class="toctext">Other</span></a></li> <li class="toclevel-1 tocsection-7"><a href="#See_also"><span class="tocnumber">7</span> <span class="toctext">See also</span></a></li> </ul> </div> </div> <h2><span id="Art.2C_entertainment.2C_and_media"></span><span class="mw-headline" id="Art,_entertainment,_and_media">Art, entertainment, and media</span></h2> <ul> <li><a href="/wiki/Create_(TV_network)" title="Create (TV network)">Create (TV network)</a>, an American public television network consisting of lifestyle and human interest programming from the libraries of PBS and American Public Television</li> <li><a href="/wiki/Create_(video_game)" title="Create (video game)"><i>Create</i> (video game)</a>, a 2010 video game published by EA</li> </ul> <h2><span class="mw-headline" id="Brands_and_enterprises">Brands and enterprises</span></h2> <ul> <li><a href="/wiki/Create_(nightclub)" class="mw-redirect" title="Create (nightclub)">Create (nightclub)</a>, a entertainment venue in Los Angeles</li> </ul> <h2><span class="mw-headline" id="Computing_and_technology">Computing and technology</span></h2> <ul> <li><a href="/wiki/Chicago_Region_Environmental_and_Transportation_Efficiency_Program" title="Chicago Region Environmental and Transportation Efficiency Program">Chicago Region Environmental and Transportation Efficiency Program</a>, a proposed improvement to the rail lines in the Chicago area</li> <li><a href="/wiki/Create,_read,_update_and_delete" title="Create, read, update and delete">Create, read, update and delete</a>, create is one of the four basic functions of persistent storage identified in the acronym CRUD <ul> <li><a href="/wiki/CREATE_(SQL)" class="mw-redirect" title="CREATE (SQL)">CREATE (SQL)</a>, a statement in SQL</li> </ul> </li> <li><a href="/wiki/IRobot_Create" title="IRobot Create">iRobot Create</a>, a hobbyist robot based on the iRobot Roomba platform</li> </ul> <h2><span class="mw-headline" id="Organizations_and_programs">Organizations and programs</span></h2> <ul> <li><a href="/wiki/Create_Project" title="Create Project">Create Project</a>, a web-based community focused on communication and sharing between Free and Open Source Creative applications</li> </ul> <h2><span class="mw-headline" id="Transportation">Transportation</span></h2> <ul> <li><a href="/wiki/Chicago_Region_Environmental_and_Transportation_Efficiency_Program" title="Chicago Region Environmental and Transportation Efficiency Program">Chicago Region Environmental and Transportation Efficiency Program</a>, a series of projects to improve rail lines in the Chicago area</li> </ul> <h2><span class="mw-headline" id="Other">Other</span></h2> <ul> <li><a href="/wiki/Ennoblement" title="Ennoblement">Ennoblement</a> To create someone a title is to grant that title to them</li> </ul> <h2><span class="mw-headline" id="See_also">See also</span></h2> <ul> <li><a href="/wiki/Creation_(disambiguation)" class="mw-redirect mw-disambig" title="Creation (disambiguation)">Creation (disambiguation)</a></li> </ul> <table id="disambigbox" class="metadata plainlinks dmbox dmbox-disambig" style="" role="presentation"> <tr> <td class="mbox-image" style="padding: 2px 0 2px 0.4em;"><a href="/wiki/File:Disambig_gray.svg" class="image"><img alt="Disambiguation icon" src="//upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/30px-Disambig_gray.svg.png" width="30" height="23" srcset="//upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/45px-Disambig_gray.svg.png 1.5x, //upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/60px-Disambig_gray.svg.png 2x" data-file-width="220" data-file-height="168" /></a></td> <td class="mbox-text" style="padding: 0.25em 0.4em; font-style: italic;">This <a href="/wiki/Help:Disambiguation" title="Help:Disambiguation">disambiguation</a> page lists articles associated with the title <b>Create</b>.<br /> <small>If an <a class="external text" href="//en.wikipedia.org/w/index.php?title=Special:WhatLinksHere/Create&amp;namespace=0">internal link</a> led you here, you may wish to change the link to point directly to the intended article.</small></td> </tr> </table>   <!--  NewPP limit report Parsed by mw1240 Cached time: 20171220194515 Cache expiry: 1900800 Dynamic content: false CPU ti